(3537, 'default', 'created', 'App\\Models\\Property', 'created', 90, 'App\\Models\\User', 106, '{\"attributes\":{\"user_id\":106,\"property_type_id\":2,\"property_type_custom\":null,\"property_class\":\"residential\",\"basic_rate_commission_id\":null,\"kitchen_area_size\":\"120.00\",\"kitchen_area_units\":\"ft2\",\"living_area_size\":\"10.00\",\"living_area_units\":\"ft2\",\"heating_features\":\"air_conditioner\",\"aditional_features\":[\"new_development\",\"luxurious\",\"under_construction\",\"empty\",\"neoclassical\",\"unfinished\",\"renovated\"],\"suitable_for\":[\"holiday_home\",\"student\",\"tourist_rental\",\"investment\",\"professional_use\"],\"suitable_for_custom\":null,\"common_expences\":\"800.00\",\"year_of_construction\":2021,\"year_of_renovation\":2024,\"price_for_sale_eur\":\"120000.00\",\"price_for_sale_per_sq_m\":\"999.90\",\"return_on_investment\":\"520.00\",\"title\":\"property sale test\",\"slug\":\"property-sale-test-684bf751de5f2\",\"active\":1,\"approval_status\":\"pending\",\"floorspace\":\"1200.00\",\"floorspace_units\":\"ft2\",\"grounds\":null,\"grounds_units\":null,\"floors_in_building\":null,\"floors_of_property\":null,\"entrance\":null,\"rental_licence_type_id\":null,\"rental_licence_number\":null,\"latitude\":\"50.00000000\",\"longitude\":\"30.00000000\",\"country\":\"IN\",\"street\":\"j 38 sec 63\",\"address\":null,\"apartment_floor_building\":null,\"city\":\"Noida\",\"state_or_region\":\"Uttar Pradesh\",\"postal_code\":\"201301\",\"orientation\":null,\"commercial_title\":\"Beautiful Seafront Villa for Summer and All-Season Getaways!\",\"headline\":\"Beautiful Seafront Villa for Summer and All-Season Getaways!\",\"short_summary\":\"This stunning 3-level villa in Triportamos, Sithonia, comfortably accommodates up to 10 guests and is perfect for families or large groups seeking a relaxing vacation. With 5 bedrooms, 3 bathrooms, fully-equipped kitchen, and multiple terraces overlooking the sea, this villa is a true gem.\",\"brief_description\":\"Beautiful Seafront Villa for Summer and All-Season Getaways!\",\"description\":\"<p>This gorgeous seafront villa is the ultimate destination for a relaxing and unforgettable vacation. Situated in a safe and quiet residential complex in Triportamos, Sithonia, the villa comfortably accommodates up to 10 guests across its 5 bedrooms, 3 bathrooms, and 3 levels of living space.<\\/p><p>The first level boasts a kitchen, living and dining area, a bathroom, and a bedroom with a double bed. Two large terraces with tables, chairs, sofas, wooden beds, and lush greenery surround the front and back of the house, offering ample opportunities to relax and enjoy the sea breeze.<\\/p><p>On the second level, you will find an additional comfortable bathroom and 3 bedrooms, 2 of which have double beds and built-in closets, while the third has a sofa that converts into two single beds and an internal staircase leading to the attic. The third level, or the attic, features another double bed and two terraces with sea views.<\\/p><p>The villa is equipped with a dishwasher and a fully equipped kitchen to ensure your stay is comfortable and convenient. It is also designed to serve people with limited mobility or the elderly, with a parking space for 2-3 cars.<\\/p><p>Located less than 5 km from Marmaras, where you can find supermarkets, pharmacies, restaurants, cafes, and bars, the villa is conveniently situated near all the amenities you need. A supermarket and a restaurant for everyday needs are also located nearby, while the villa provides a private beach umbrella and sun loungers for all residents.<\\/p>\",\"suitable_for_kids\":null,\"events_allowed\":0,\"pets\":0,\"max_pets\":0,\"pets_fee\":0,\"wheelchair_access\":0,\"smoking_allowed\":null,\"camera\":null,\"noise_monitor\":0,\"house_rules\":null,\"basic_night_net\":null,\"basic_night_gross\":null,\"weekend_night_net\":null,\"weekend_night_gross\":null,\"monthly_rate\":null,\"monthly_rate_sqm\":null,\"max_guests\":null,\"min_stay_nights\":null,\"max_stay_nights\":null,\"checkin_mon\":false,\"checkin_tue\":false,\"checkin_wed\":false,\"checkin_thu\":false,\"checkin_fri\":false,\"checkin_sat\":false,\"checkin_sun\":false,\"checkin_any\":false,\"checkout_mon\":false,\"checkout_tue\":false,\"checkout_wed\":false,\"checkout_thu\":false,\"checkout_fri\":false,\"checkout_sat\":false,\"checkout_sun\":false,\"checkout_any\":false,\"is_cleaning\":false,\"advance_booking_notice\":null,\"cancellation_policy\":null,\"additional_policy\":null,\"rates_increase\":null,\"rates_decrease\":null,\"additional_policy_2\":null,\"rates_increase_2\":null,\"rates_decrease_2\":null,\"allow_external_ical\":null,\"export_ical_url\":null,\"url_for_site_presentation\":null,\"planyo_resource_id\":null}}', NULL, '2025-06-13 04:32:57', '2025-06-13 04:32:57'),
