um_mp_container) {\n              viveum_mp_container.style.display=\'block\';\n              if (viveum_mp_container.getElementsByTagName(\'form\').length > 0) {\n                for(var i=0; i<viveum_mp_container.getElementsByTagName(\'form\').length; i++) {\n                  viveum_mp_container.getElementsByTagName(\'form\')[i].style.display=\'block\';\n                }\n              }\n            }\n            document.forms[\'multipay_form\'].style.display=\'none\';\n          }\n          else {\n            document.forms[form_name].submit();\n          }\n        }\n        </script></div>\n        <script type=\'text/javascript\'>\n        function planyo_payment_send() {\n          var radioObj = document.forms[\'multipay_form\'].method;\n          var radioLength = radioObj.length;\n          if (radioLength != undefined) {\n            for(var i = 0; i < radioLength; i++) {\n              if(radioObj[i].checked) {\n                var form_name = radioObj[i].value;\n                submit_payment_method(form_name);\n                return false;\n              }\n            }\n          }\n          else if (radioObj.value) {\n            submit_payment_method(radioObj.value);\n            return false;\n          }\n          alert(\"Payment method must be selected\");\n          return false;\n        }\n        </script>\n            <form name=\'multipay_form\' style=\'display:inline;\' onsubmit=\'planyo_payment_send();return false\'>\n            <span id=\'pay_opt_1\'>\n<input type=\'radio\' id=\'pay_radio_1\' name=\'method\' value=\'_xclick\' /> <label for=\'pay_radio_1\'>PayPal</label><span id=\'paypal_logo\' style=\'display:inline-block;margin-left:30px;margin-top:20px;width:150px;height:38px;vertical-align:bottom;background-image:url(\"https://sandbox.planyo.com/images/pp-logo.png\")\'></span><br/></span><span id=\'pay_opt_107\'>\n<input type=\'radio\' id=\'pay_radio_107\' name=\'method\' value=\'stripe_checkout_form\' /> <label for=\'pay